import React,{useState}  from "react";
 import FormInput from "./FormInput";
  
  
 
function Login_form({ onSubmit }){
  function Submit(e){
    e.preventDefault();
  }
  function evnet(e)
    {
      console.log(e.target.name);
      console.log(e.target.value);
      
    }
    return(
       <>
    
              {/* <!-- End Logo --> */}
              <div className="d-flex justify-content-center py-4">
                <a href="index.html" className="logo d-flex align-items-center w-auto">
                  <img src="my_img/logo.png" alt="profile-logo"/>
                  <span className="d-none d-lg-block">user-profile</span>
                </a>
              </div>

              <div className="card mb-3">

                <div className="card-body">

                  <div className="pt-4 pb-2">
                    <h5 className="card-title text-center pb-0 fs-4">Login to Your Account</h5>
                     <p className="text-center small">Enter your username & password to login</p>
                  </div>

                  <form className="row g-3 needs-validation" novalidate  method="post" onSubmit={Submit} >

                    <div className="col-12">
                      <FormInput label_val={"username"} labelmsg="username" type={"text"} name={"username"} id={"username"} placeholder="username"msg={"username"} onChange={evnet}/>                
                       </div>

                    <div className="col-12">
                    <FormInput label_val={"psw"} labelmsg="password" type={"password"} name={"psw"} id={"psw"} placeholder="password"msg={"password"} onChange={evnet}/>                

                    </div>

                    <div className="col-12">
                      <div className="form-check">
                        <input className="form-check-input" type="checkbox" name="remember" value="true" id="rememberMe"/>
                        <label className="form-check-label" for="rememberMe">Remember me</label>
                      </div>
                    </div>
                    <div className="col-12">
                      <button className="btn btn-primary w-100" type="submit" id="submit"  >Login</button>
                    </div>
                    <div className="col-12">
                      <p className="small mb-0">Don't have user-profile account? <a href="pages-register.html">Create a user-profile</a></p>
                    </div>
                  </form>

                </div>
              </div>

              

         

</>
       
       
    )
}

export default Login_form;
